import './App.css';
import React from 'react';
import axios from 'axios';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = ({apiResponse:""});
  }

  callAPI() {
      const formData = {
        someText: "neki text"
      }
      axios
      .post('http://localhost:5000/testAPI', formData)
      .then(() => console.log('POST Request sent'))
      .catch(err => {
        console.error(err);
      });
  } 

  render() {
    return (
      <div className="App">

        <button onClick={() => this.callAPI()}>Send data</button>
        <p>{this.state.apiResponse}</p>
      </div>
    );
  }
}

export default App;
